import React, { Component } from 'react'
import { contact as contactsFromFakeApi } from './../contacts'
import ContactCard from './Contacts-card'

class ContactsList extends Component {
    constructor() {
        super()
        this.state = {
            contacts: contactsFromFakeApi
        }
    }
    render() {
        return (
            <table>
                <tr>
                    <th>Picture</th>
                    <th>Name</th>
                    <th>Popularity</th>
                </tr>
                <tr>
                    {ContactsList.map(elm => <ContactCard key={elm.id} {...elms} />)}
                </tr>
            </table>
        )
    }
}

export default ContactsList
